{
  "$schema": "http://json-schema.org/draft-07/schema#",
  "title": "Fraud-Checked Order",
  "type": "object",
  "properties": {
    "order_id": {
      "type": "string",
      "description": "Unique identifier for the order"
    },
    "customer": {
      "$ref": "#/definitions/customer",
      "description": "Customer placing the order"
    },
    "items": {
      "type": "array",
      "items": {
        "$ref": "#/definitions/order_item"
      },
      "description": "Items included in the order"
    },
    "total_price": {
      "type": "number",
      "minimum": 0,
      "description": "Total price of the order"
    },
    "order_date": {
      "type": "string",
      "format": "date-time",
      "description": "Date and time when the order was placed"
    },
    "status": {
      "type": "string",
      "enum": ["pending", "processing", "shipped", "delivered", "cancelled"],
      "description": "Status of the order"
    },
    "fraud_check": {
      "type": "object",
      "properties": {
        "risk_score": {
          "type": "number",
          "minimum": 0,
          "maximum": 100,
          "description": "Risk score assigned to the order"
        },
        "reasons": {
          "type": "array",
          "items": {
            "type": "string"
          },
          "description": "Reasons for the risk assessment"
        }
      },
      "required": ["risk_score", "reasons"]
    }
  },
  "required": ["order_id", "customer", "items", "total_price", "order_date", "status", "fraud_check"],
  "definitions": {
    "customer": {
      "type": "object",
      "properties": {
        "id": {
          "type": "string",
          "description": "Unique identifier for the customer"
        },
        "name": {
          "type": "string",
          "description": "Name of the customer"
        },
        "email": {
          "type": "string",
          "format": "email",
          "description": "Email address of the customer"
        }
      },
      "required": ["id", "name", "email"]
    },
    "order_item": {
      "type": "object",
      "properties": {
        "item_id": {
          "type": "string",
          "description": "Unique identifier for the item"
        },
        "quantity": {
          "type": "integer",
          "minimum": 1,
          "description": "Quantity of the item ordered"
        },
        "price": {
          "type": "number",
          "minimum": 0,
          "description": "Price per unit of the item"
        }
      },
      "required": ["item_id", "quantity", "price"]
    }
  }
}

